COMMENT ON COLUMN "public"."syslog"."createid" IS '操作人ID';
COMMENT ON COLUMN "public"."syslog"."createname" IS '操作人';
COMMENT ON COLUMN "public"."syslog"."ip" IS '操作机器的IP地址';
